import classes from './Positiv.module.css';
import React, {useState,useEffect,useHistory,useContext} from 'react';
//MUI
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import IconButton from '@mui/material/IconButton';
//comps
import PositivBox from './PositivBox'
//ContextProvider
import {AllDataContext} from '../ContextProvider'
import {ChangeAllDataContext} from '../ContextProvider'

function Positiv(props){

    //allData:{data,negative,positiv}
    const allData = useContext(AllDataContext)
    const changeAllData = useContext(ChangeAllDataContext)

    var positiv1,positiv2,positiv3,positiv4,positiv5,positiv6,positiv7,positiv8,positiv9,positiv10

    return (
        <div className={classes.container}>

            <div className={classes.spalte}>
                <PositivBox var={"positiv1"} positivNumber={"allData?.positiv?.positiv1"} positivText={"1.  Zusammenarbeit im Projekt/ Teamspirit und Konfliktkultur"}/>
                <PositivBox var={"positiv2"} positivNumber={"allData?.positiv?.positiv2"} positivText={"2.  Zusammenarbeit mit dem Kunden/ Teamspirit und Konfliktkultur"}/>
                <PositivBox var={"positiv3"} positivNumber={"allData?.positiv?.positiv3"} positivText={"3.  Projektorganisation und Projektmanagement genrell"}/>
                <PositivBox var={"positiv4"} positivNumber={"allData?.positiv?.positiv4"} positivText={"4.  Projektkommunikation"}/>
                <PositivBox var={"positiv5"} positivNumber={"allData?.positiv?.positiv5"} positivText={"5.  Ziele und Projektausrichtung"}/>
            </div>

            <div className={classes.spalte}>
                <PositivBox var={"positiv6"} positivNumber={"allData?.positiv?.positiv6"} positivText={"6.  Abläufe, Prozesse und Qualitätssicherungs"}/>
                <PositivBox var={"positiv7"} positivNumber={"allData?.positiv?.positiv7"} positivText={"7.  Rollen und Aufgabenverteilung"}/>
                <PositivBox var={"positiv8"} positivNumber={"allData?.positiv?.positiv8"} positivText={"8.  Ressourcen"}/>
                <PositivBox var={"positiv9"} positivNumber={"allData?.positiv?.positiv9"} positivText={"9.  Führung und Motivation"}/>
                <PositivBox var={"positiv10"} positivNumber={"allData?.positiv?.positiv10"} positivText={"10.  Entwicklungsverständnis und Erstellung Liefergegenstände"}/>

            </div>


        </div>
    );
}

export default Positiv;
